	private static void test1(){
		Calendar calendar = Calendar.getInstance();
		calendar.set(2019, 1, 10, 0, 0, 0);
		Date date1 = calendar.getTime();

		Calendar calendar2 = Calendar.getInstance();
		calendar2.set(2020, 11, 17, 0, 0, 0);
		Date date2 = calendar2.getTime();

		int day = calendar2.get(Calendar.DAY_OF_YEAR) - calendar.get(Calendar.DAY_OF_YEAR);
		int year = calendar2.get(Calendar.YEAR) - calendar.get(Calendar.YEAR);
		System.out.println("1:" + ( date1.getTime() - date2.getTime()));
		System.out.println("2:" + day);
		System.out.println("3:" + year);
		System.out.println("4:" + (int)( (date2.getTime() - date1.getTime()) / (1000 * 60 * 60 * 24)));

	}

