	private static void test3(){
		BASE64Encoder encoder = new BASE64Encoder();
		String text = "张三";
		byte[] arr = text.getBytes();
		byte[] arr2 = new byte[40];

		arr2[0] = arr[0];
		arr2[1] = arr[1];
		arr2[2] = arr[2];
		arr2[3] = arr[3];
		arr2[4] = arr[4];
		arr2[5] = arr[5];

		for(int i = 6 ; i <= 39 ; i++){
			arr2[i] = 1;
		}


		System.out.println(encoder.encode(arr2));
	}
